\">¿Por qué nosotros?</h2>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"3.0.101\" make_fullwidth=\"on\"][et_pb_column type=\"1_2\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.0.101\"]<div class=\"et_pb_text\" style=\"padding-top: 20px;\">\n<ol>\n<li><span class=\"number_divider\"></span><span style=\"font-weight: 900; font-size: 24px;\">EXPERIENCIA</span>\n<p>Miles de horas técnicas de servicio.\n</p>\n</li>\n<li><span class=\"number_divider\"></span><span style=\"font-weight: 900; font-size: 24px;\">CONFIANZA<br /></span>\n<p>Apoyo continuo de nuestros técnicos y desarrolladores.\n</p>\n</li>\n<li><span style=\"font-weight: 900; font-size: 24px;\">MÓVIL</span>\n<p>Nos trasladamos al sitio para atender tus requerimientos.\n</p>\n</li>\n<li><span style=\"font-weight: 900; font-size: 24px;\">RÁPIDOS</span>\n<p>Resolvemos tus problemas técnicos en tiempo record.\n</p>\n</li>\n<li><span style=\"font-weight: 900; font-size: 24px;\">REMOTO</span>\n<p>Mantenemos tus equipos en la vanguardia tecnológica.\n</p>\n</li>\n</ol>\n</div>\n</div>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_image src=\"https://isistechnologyny.com//wp-content/uploads/2018/07/logo-white.png\" _builder_version=\"3.0.101\"][/et_pb_image][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" module_id=\"how-we-do\" _builder_version=\"3.0.101\" background_image=\"https://isistechnologyny.com//wp-content/uploads/2018/07/section.jpg\"][et_pb_row _builder_version=\"3.0.101\"][et_pb_column type=\"4_4\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.0.101\" header_font=\"||||||||\" header_2_font=\"cocogoose||||||||\" header_2_font_size=\"40px\"]<div style=\"text-align: center; \">\n<h2 style=\"color: white;\">¿Cómo lo hacemos?</h2>\n</div>[/et_pb_text][/et_pb_column][/et_