\">¿Por qué nosotros?</h2>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"3.0.101\" make_fullwidth=\"on\" custom_padding=\"27px|0px|27px|0px\"][et_pb_column type=\"1_2\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.0.101\"]<div class=\"et_pb_text\" style=\"padding-top: 20px;\">\n<ol>\n<li><span class=\"number_divider\"></span><span style=\"font-weight: 900; font-size: 24px;\">EXPERIENCIA</span>\n<p>Miles de horas técnicas de servicio.\n</p>\n</li>\n<li><span class=\"number_divider\"></span><span style=\"font-weight: 900; font-size: 24px;\">CONFIANZA<br /></span>\n<p>Apoyo continuo de nuestros técnicos y desarrolladores.\n</p>\n</li>\n<li><span style=\"font-weight: 900; font-size: 24px;\">MÓVIL</span>\n<p>Nos trasladamos al sitio para atender tus requerimientos.\n</p>\n</li>\n<li><span style=\"font-weight: 900; font-size: 24px;\">RÁPIDOS</span>\n<p>Resolvemos tus problemas técnicos en tiempo record.\n</p>\n</li>\n<li><span style=\"font-weight: 900; font-size: 24px;\">REMOTO</span>\n<p>Mantenemos tus equipos en la vanguardia tecnológica.\n</p>\n</li>\n</ol>\n</div>\n</div>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_image src=\"https://isistechnologyny.com//wp-content/uploads/2018/07/logo-white.png\" _builder_version=\"3.0.101\" align=\"center\"][/et_pb_image][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" module_id=\"how-we-do\" _builder_version=\"3.0.101\" background_image=\"https://isistechnologyny.com//wp-content/uploads/2018/07/section.jpg\"][et_pb_row _builder_version=\"3.0.101\"][et_pb_column type=\"4_4\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.0.101\" header_font=\"||||||||\" header_2_font=\"cocogoose||||||||\" header_2_font_size=\"40px\"]<div style=\"text-align: center; \">\n<h2 style=\"color: white;\">¿Cómo lo hacemos?</h2>\n</div>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"3.0.101\"][et_pb_column type=\"1_2\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.0.101\" text_font=\"||||||||\" header_font=\"cocogoose||||||||\" header_2_font=\"cocogoose||||||||\" header_2_line_height=\"1.2em\"]<div style=\"text-align: center;\">\n<div class=\"icon\"><i style=\"color: #ffffff; font-size: 7em;\" class=\"fas fa-user-alt\"></i></div>\n<div style=\"margin-top: 20px;\">\n<h2 style=\"color: #ffffff;\">Presencial</h2>\n</div>\n<p style=\"color: white;\">Nos trasladamos a tu hogar u oficina prestándote un servicio técnico de calidad y totalmente personalizado.\n</p>\n</div>[/et_pb_text][/et_pb_column][et_pb_column type=\"1_2\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_text _builder_version=\"3.0.101\" header_font=\"cocogoose||||||||\" header_2_font=\"cocogoose||||||||\" header_2_line_height=\"1.2em\"]<div style=\"text-align: center;\">\n<div class=\"icon\"><i style=\"color: white; font-size: 7em;\" class=\"fas fa-user-circle\"></i></div>\n<div style=\"margin-top: 20px;\">\n<h2 style=\"color: white;\">Virtual</h2>\n</div>\n<p style=\"color: white;\">De manera remoto te prestamos el servicio desde cualquier lugar en que te encuentres.</p>\n</div>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row _builder_version=\"3.0.101\"][et_pb_column type=\"4_4\" _builder_version=\"3.0.101\" parallax=\"off\" parallax_method=\"on\"][et_pb_button button_url=\"#contacto\" button_text=\"Contratar servicio\" button_alignment=\"center\" _builder_version=\"3.0.101\" custom_button=\"on\" button_text_color=\"#ffffff\" button_bg_color=\"#070a2d\" button_border_color=\"rgba(7,10,45,0.46)\" button_font=\"||||||||\"][/et_pb_button][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built=\"1\" module_id=\"us\" _builder_version=\"3.0.101\"][et_pb_row _builder_version=\"3.0.101\" animation_style=