(103, 1, '2018-08-10 01:55:39', '2018-08-10 01:55:39', '<div id=\"responsive-form\" class=\"clearfix\">\r\n\r\n<div class=\"form-row\">\r\n<div class=\"column-half\">Nombre [text* your-name]</div>\r\n<div class=\"column-half\">Email [email* your-email]</div>\r\n</div>\r\n\r\n<div class=\"form-row\">\r\n<div class=\"column-full\">[submit \"Enviar\"]</div>\r\n</div>\r\n\r\n</div><!--end responsive-form-->\n1\nIsis Tecnology - Formulario de Contacto\nIsis <isis@isistechnologyny.com>\nisistechnologyny@gmail.com\nHola, isis. [your-name] se ha suscrito a la revisión gratuita.\r\n\r\nDatos:\r\nNombre: [your-name]\r\nCorreo: [your-email]\r\n\r\n-- \r\n<p style=\"font-size: 12px\">This e-mail was sent from a contact form on Isis Tecnology (isistechnology.com)</p>\nReply-To: [your-email]\n\n1\n\n1\n[your-name], tu revisión gratuita está esperando por ti - Isis Technology\nIsis Tecnology <isis@isistechnologyny.com>\n[your-email]\nHola, [your-name]. Gracias por ponerte en contacto con nosotros.\r\n\r\nTienes un cupón que aplica para una revisión GRATUITA (Ciertas condiciones aplican). Aquí lo tienes: <b>ISISTECH2018</b>\r\n\r\n\r\n\r\n-- \r\n<p style=\"font-size: 12px\">This e-mail was sent from a contact form on Isis Tecnology (< a href=\"https://isistechnologyny.com\"> isistechnology.com</a>)</p>\n\n\n1\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Revisión Gratis', '', 'publish', 'closed', 'closed', '', 'revision-gratis', '', '', '2018-08-10 17:41:05', '2018-08-10 17:41:05', '', 0, 'https://isistechnologyny.com/?post_type=wpcf7_contact_form&#038;p=103', 0, 'wpcf7_contact_form', '', 0),
